    "  \n",
    "  if (model_name == \"Logistic Regression\") {\n",
    "    fit <- train(Survived ~ ., data = train_set, method = model$method, trControl = fit_control, tuneGrid = model$tuneGrid, family = model$family)\n",
    "  } else {\n",
    "    fit <- train(Survived ~ ., data = train_set, method = model$method, trControl = fit_control, tuneGrid = model$tuneGrid)\n",
    "  }\n",
    "  \n",
    "  results[[model_name]] <- fit\n",
    "}"
